#
# TABLE STRUCTURE FOR: education
#

DROP TABLE IF EXISTS `education`;

CREATE TABLE `education` (
  `order_id` bigint(20) unsigned NOT NULL,
  `town` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `education_institution` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_statement` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  CONSTRAINT `education_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `order_services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='to apply for admission to an educational institution';



#
# TABLE STRUCTURE FOR: family
#

DROP TABLE IF EXISTS `family`;

CREATE TABLE `family` (
  `order_id` bigint(20) unsigned NOT NULL,
  `town` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `registry_office` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_statement` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  CONSTRAINT `family_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `order_services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Marriage registration table';



#
# TABLE STRUCTURE FOR: health_cares
#

DROP TABLE IF EXISTS `health_cares`;

CREATE TABLE `health_cares` (
  `order_id` bigint(20) unsigned NOT NULL,
  `town` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `hospital_name` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL,
  `which_doctor` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_problem` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  CONSTRAINT `healthy_cares_fk_1` FOREIGN KEY (`order_id`) REFERENCES `order_services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Doctor appointment table';



#
# TABLE STRUCTURE FOR: order_services
#

DROP TABLE IF EXISTS `order_services`;

CREATE TABLE `order_services` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `users_id` bigint(20) unsigned DEFAULT NULL,
  `price` double(10,2) DEFAULT NULL,
  `description_order` varchar(250) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT NULL ON UPDATE current_timestamp(),
  UNIQUE KEY `id` (`id`),
  KEY `users_id` (`users_id`),
  CONSTRAINT `order_services_ibfk_1` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=151 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Order table, contains order data';



#
# TABLE STRUCTURE FOR: passport_viz
#

DROP TABLE IF EXISTS `passport_viz`;

CREATE TABLE `passport_viz` (
  `order_id` bigint(20) unsigned NOT NULL,
  `place_birth` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `citizenship` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `town` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `passport_office` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_statement` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`order_id`),
  CONSTRAINT `passport_viz_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `order_services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Obtaining citizenship or visa';



#
# TABLE STRUCTURE FOR: passports
#

DROP TABLE IF EXISTS `passports`;

CREATE TABLE `passports` (
  `profiles_id` bigint(20) unsigned NOT NULL,
  `series` int(10) unsigned DEFAULT NULL,
  `numbers` int(10) unsigned DEFAULT NULL,
  `issued_by_whom` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`profiles_id`),
  UNIQUE KEY `series` (`series`),
  UNIQUE KEY `numbers` (`numbers`),
  CONSTRAINT `passports_fk_1` FOREIGN KEY (`profiles_id`) REFERENCES `profiles` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Main document';



#
# TABLE STRUCTURE FOR: photos
#

DROP TABLE IF EXISTS `photos`;

CREATE TABLE `photos` (
  `users_id` bigint(20) unsigned NOT NULL,
  `order_services_id` bigint(20) unsigned NOT NULL,
  KEY `users_id` (`users_id`),
  KEY `order_services_id` (`order_services_id`),
  CONSTRAINT `photos_ibfk_1` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`),
  CONSTRAINT `photos_ibfk_2` FOREIGN KEY (`order_services_id`) REFERENCES `order_services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Some operations require a photo';



#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `users_id` bigint(20) unsigned NOT NULL,
  `gender` enum('f','m') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `birthday` date DEFAULT NULL,
  `snils` bigint(11) unsigned DEFAULT NULL,
  `individual_tax_number` bigint(12) unsigned DEFAULT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  `updated_at` datetime DEFAULT NULL ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `snils` (`snils`),
  UNIQUE KEY `individual_tax_number` (`individual_tax_number`),
  KEY `users_id` (`users_id`),
  CONSTRAINT `profiles_ibfk_1` FOREIGN KEY (`users_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=117 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Table of personal data of users';



#
# TABLE STRUCTURE FOR: tax_finances
#

DROP TABLE IF EXISTS `tax_finances`;

CREATE TABLE `tax_finances` (
  `order_id` bigint(20) unsigned NOT NULL,
  `town` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `tax_office` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_statement` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`order_id`),
  CONSTRAINT `tax_finances_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `order_services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='For inquiries to the tax office';



#
# TABLE STRUCTURE FOR: transport_value
#

DROP TABLE IF EXISTS `transport_value`;

CREATE TABLE `transport_value` (
  `order_id` bigint(20) unsigned NOT NULL,
  `town` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `police_department` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `description_statement` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`order_id`),
  CONSTRAINT `transport_value_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `order_services` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Police report table';



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `surname` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `name` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `patronymic` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'for residents of russia',
  `email` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `password_hash` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `telephone` bigint(20) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `telephone` (`telephone`),
  KEY `users_surname_name_idx` (`surname`,`name`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: users_family
#

DROP TABLE IF EXISTS `users_family`;

CREATE TABLE `users_family` (
  `profiles_id` bigint(20) unsigned NOT NULL,
  `married` enum('yes','no') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `wife` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `telefone_wife` int(10) unsigned DEFAULT NULL,
  `children` int(10) unsigned DEFAULT 0 COMMENT 'quantity',
  `father` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `telefone_father` int(10) unsigned DEFAULT NULL,
  `mother` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `telefone_mother` int(10) unsigned DEFAULT NULL,
  UNIQUE KEY `profiles_id` (`profiles_id`),
  CONSTRAINT `users_family_ibfk_1` FOREIGN KEY (`profiles_id`) REFERENCES `profiles` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Everything about marital status';



